import React from "react";
import Card from "./components/Card";

function HomePage() {
  return (
    <div>
      <h1>My First React App</h1>
      <Card imgSrc={process.env.PUBLIC_URL + "/assets/profile.jpg"} />
      <Card imgSrc={process.env.PUBLIC_URL + "/assets/profile2.jpg"} />
    </div>
  );
}

export default HomePage;
